import './estilo.css'

export default function Topo(){
    return(
        <header>
            <div>
                <img src="logo.png" alt=""/>
            </div>
            <div>
                <a href="">Home</a>
                <a href="">Sobre</a>
                <a href="">Pro</a>
                <a href="">Home</a>
            </div>
        </header>
    );
}
